import '../App.css';
import { BrowserRouter, Switch, Route, Link, useHistory } from "react-router-dom";
import List_product from"./List_product";
import InsertProduct from"./InsertProduct";


function AdminRout() {
    const history = useHistory();

    const handleClick = () => {
        history.push("/signin");
    }
  return (
    <div>
        <BrowserRouter>
    {/* Page Wrapper */}
    <div id="wrapper">

        {/* Sidebar */}
        <ul className="navbar-nav bg-gradient-primary sidebar sidebar-dark accordion" id="accordionSidebar">

            {/* Sidebar - Brand */}
            <a className="sidebar-brand d-flex align-items-center justify-content-center" href="index.html">
                <div className="sidebar-brand-icon rotate-n-15">
                    <i className="fas fa-laugh-wink"></i>
                </div>
                <div className="sidebar-brand-text mx-3">SB Admin <sup>2</sup></div>
            </a>

            {/* Divider */}
            <hr className="sidebar-divider my-0"/>


            {/* Nav Item - Charts */}
            <li className="nav-item">
                <Link className="nav-link" to="/add-product">
                    <i className="fas fa-fw fa-chart-area"></i>
                    <span>Indert Product</span></Link>
            </li>
            <li className="nav-item">
                <Link className="nav-link" to="/signin">
                    <i className="fas fa-fw fa-chart-area"></i>
                    <span>login</span></Link>
            </li>

            {/* Nav Item - Tables */}
            <li className="nav-item">
                <Link className="nav-link" to="/dashboard">
                    <i className="fas fa-fw fa-table"></i>
                    <span>List Product</span></Link>
            </li>

            {/* Divider */}
            <hr className="sidebar-divider d-none d-md-block"/>

            {/* Sidebar Toggler (Sidebar) */}
            <div className="text-center d-none d-md-inline">
                <button className="rounded-circle border-0" id="sidebarToggle"></button>
            </div>

        </ul>
        {/* End of Sidebar */}

        {/* Content Wrapper */}
        <div id="content-wrapper" className="d-flex flex-column">

            {/* Main Content */}
            <div id="content">

                {/* Topbar */}
                <nav className="navbar navbar-expand navbar-light bg-white topbar mb-4 static-top shadow">

                    {/* Sidebar Toggle (Topbar) */}
                    <button id="sidebarToggleTop" className="btn btn-link d-md-none rounded-circle mr-3">
                        <i className="fa fa-bars"></i>
                    </button>

                    {/* Topbar Search */}
                    <form
                        className="d-none d-sm-inline-block form-inline mr-auto ml-md-3 my-2 my-md-0 mw-100 navbar-search">
                        <div className="input-group">
                            <input type="text" className="form-control bg-light border-0 small" placeholder="Search for..."
                                aria-label="Search" aria-describedby="basic-addon2"/>
                            <div className="input-group-append">
                                <button className="btn btn-primary" type="button">
                                    <i className="fas fa-search fa-sm"></i>
                                </button>
                            </div>
                        </div>
                    </form>

                    {/* Topbar Navbar */}
                    <ul className="navbar-nav ml-auto">
                       
                    </ul>

                </nav>
                {/* End of Topbar */}

                {/* Begin Page Content */}
                <div className="container-fluid">

                    {/* Page Heading */}
                
                  


                    <button onClick={handleClick} type="button">sign up</button>


                  <Switch>
                    <Route exact path='/dashboard' component={List_product}  />
                    <Route exact path='/dashboard/add-product' component={InsertProduct}  />
                  </Switch>


                  
                </div>
                {/* /.container-fluid */}

            </div>
            {/* End of Main Content */}

            {/* Footer */}
            {/* <footer className="sticky-footer bg-white">
                <div className="container my-auto">
                    <div className="copyright text-center my-auto">
                        <span>Copyright &copy; Your Website 2020</span>
                    </div>
                </div>
            </footer> */}
            {/* End of Footer */}

        </div>
        {/* End of Content Wrapper */}

    </div>
    {/* End of Page Wrapper */}

    {/* Scroll to Top Button*/}
    <a className="scroll-to-top rounded" href="#page-top">
        <i className="fas fa-angle-up"></i>
    </a>

    {/* Logout Modal*/}
    <div className="modal fade" id="logoutModal" tabIndex="-1" role="dialog" aria-labelledby="exampleModalLabel"
        aria-hidden="true">
        <div className="modal-dialog" role="document">
            <div className="modal-content">
                <div className="modal-header">
                    <h5 className="modal-title" id="exampleModalLabel">Ready to Leave?</h5>
                    <button className="close" type="button" data-dismiss="modal" aria-label="Close">
                        <span aria-hidden="true">Ã—</span>
                    </button>
                </div>
                <div className="modal-body">Select "Logout" below if you are ready to end your current session.</div>
                <div className="modal-footer">
                    <button className="btn btn-secondary" type="button" data-dismiss="modal">Cancel</button>
                    <a className="btn btn-primary" href="login.html">Logout</a>
                </div>
            </div>
        </div>
    </div>
    </BrowserRouter>
    </div>
  );
}

export default AdminRout;
